import React,{Component} from "react";
import { Link } from "react-router-dom";
import queryString from "query-string";
import http from "./httpService.js";
import LeftPanelOptionsCB from "./leftPanelOptionsCB.jsx";
class Persons extends Component{
    state={data:[],
    cities: ["Delhi","Noida","Gurgaon","Jaipur"],
    payments:["Credit Card","Debit Card","Wallet"],
    genders:["Male","Female"],
// ages: [25,30,35,40,45,50],
}

// handlePage = (incr) => {
//     let queryParams = queryString.parse(this.props.location.search);
//     let {page = "1"} = queryParams;
//     let newPage = +page + incr;
//     queryParams.page = newPage;
//     this.callURL("/persons",queryParams);
// }

handleOptionChange = (options) =>{
        // options.page = "1";
        this.callURL("/customers",options);
    }
    handleSort = (param) =>{
        let queryParams = queryString.parse(this.props.location.search);
    queryParams.sortBy = param;
this.callURL("/customers",queryParams);
       
    }


callURL = (url,options) => {
    let searchString = this.makeSearchString(options);
    this.props.history.push({
        pathname: url,
        search:searchString,
    })

}

makeSearchString = (options) => {
    let {city,gender,payment,sortBy} = options;
    let searchStr = "";
    searchStr = this.addToQueryString(searchStr,"gender",gender);
    searchStr = this.addToQueryString(searchStr,"city",city);
    searchStr = this.addToQueryString(searchStr,"payment",payment);

    searchStr = this.addToQueryString(searchStr,"sortBy",sortBy);



    return searchStr;
}

addToQueryString = (str,paramName,paramValue) =>
    paramValue ? str ? `${str}&${paramName}=${paramValue}` :`${paramName}=${paramValue}`: str;



    async fetchData() {
        let queryParams = queryString.parse(this.props.location.search);
        let searchStr = this.makeSearchString(queryParams);
        // let {page = "1"} = queryParams;
        let response = await http.get(`/customers?${searchStr}`);
        let {data} = response;
    this.setState({data:data});


    //     let queryParams = queryString.parse(this.props.location.search);
    //     
    // let {page = "1"} = queryParams;
    // let response = await http.get(`/personApp/persons?page=${searchStr}`);
    // console.log(response);
    // let {data} = response;
    // this.setState({data:data});

    }
componentDidMount() {


this.fetchData();
    
    
}

componentDidUpdate(prevProps,prevState){
    if(prevProps !== this.props) this.fetchData();

}

render(){
    console.log(this.state);
    const {data=[],cities,genders,payments} = this.state;
   console.log(data);
    let queryParams = queryString.parse(this.props.location.search);
    
return(<React.Fragment>
    <div className="container">
    
        
        <div className="row">
            <div className="col-1">
                <LeftPanelOptionsCB options={queryParams} cities={cities} genders={genders} payments={payments} onOptionChange={this.handleOptionChange}/>

            </div>
            <div className="col-10">
            <h4>List of Customers</h4>
        <div className="row bg-dark text-white">
            <div className="col-1 border">ID</div>
            <div className="col-2 border">NAME</div>
            <div className="col-2 border" onClick={()=>this.handleSort("age")}>AGE</div>
            <div className="col-1 border" onClick={()=>this.handleSort("city")}>CITY</div>
            <div className="col-2 border">GENDER</div>
            <div className="col-2 border" onClick={()=>this.handleSort("payment")}>PAYMENT</div>

            <div className="col-1 border"></div>
            <div className="col-1 border"></div>

        </div>

        {data.map(ele=>
        <div className="row">
            <div className="col-1 border">{ele.id}</div>
            <div className="col-2 border">{ele.name}</div>
            <div className="col-2 border">{ele.age}</div>
            <div className="col-1 border">{ele.city}</div>
            <div className="col-2 border">{ele.gender}</div>
            <div className="col-2 border">{ele.payment}</div>

            <div className="col-1 border"><Link className="btn btn-warning btn-sm" to={`/customers/${ele.id}/edit`}>Edit</Link></div>
            <div className="col-1 border"><Link className="btn btn-danger btn-sm" to={`/customers/${ele.id}/delete`}>Delete</Link></div>

        </div>)}
        
 
        
     

            </div>
        </div>
    </div>
    
</React.Fragment>)
}
}
export default Persons;
